  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides a hydrogeomorphic
  (HGM) evaluation of ecosystem restoration and management options for the Tewaukon
  and Sprague Units of Tewaukon National Wildlife Refuge (NWR) and the Hartleben,
  Gunness, Biggs, Bladow, Aaser, and Prochow Waterfowl Production Areas (WPA). These
  WPAs are collectively referred to as the Hartleben WPAs. Objectives of the report
  are:1. Describe the pre-European settlement (hereafter Presettlement) ecosystem
  condition and ecologicalprocesses in the Tewaukon NWR region. 2. Document changes
  in the Tewaukon NWR regional ecosystem from the Presettlement period with specific
  reference to alterations in hydrology, vegetationcommunity structure and distribution,
  and resource availability to key fish and wildlife species.3. Identify restoration
  and management options incorporating ecological attributes needed to restore specific
  habitats and conditions within Tewaukon NWR and the Hartleben WPAs.\",\n\t\"owner_org\":
